using System;
using System.Collections.Generic;
using System.Diagnostics;
using System.Diagnostics.CodeAnalysis;
using System.Linq;
using System.Text;
using Nibble.Collections;
using Nibble.Core;
using Nibble.Enums;
using Nibble.Serialization;
using Nibble.Shaders.Specification;
using Nibble.Utility;
using Nibble.XGeneration;
using static System.Reflection.BindingFlags;

namespace Nibble.Shaders
{
#if GENERATE
	using HType = Graphics.Buffers.Buffer.Handler.Type;

	public abstract partial class Shader
	{
		private protected static class Generation
		{
			private enum TokenType
			{
				NonSeparator,
				Separator
			}

			private static readonly IReadOnlyDictionary<string, uint> UniformTypes = new Dictionary<string, uint>
			{
				{ "atomic_uint", GL_UNSIGNED_INT_ATOMIC_COUNTER },
				{ "bool", GL_BOOL },
				{ "bvec2", GL_BOOL_VEC2 },
				{ "bvec3", GL_BOOL_VEC3 },
				{ "bvec4", GL_BOOL_VEC4 },
				{ "dmat2", GL_DOUBLE_MAT2 },
				{ "dmat2x3", GL_DOUBLE_MAT2x3 },
				{ "dmat2x4", GL_DOUBLE_MAT2x4 },
				{ "dmat3", GL_DOUBLE_MAT3 },
				{ "dmat3x2", GL_DOUBLE_MAT3x2 },
				{ "dmat3x4", GL_DOUBLE_MAT3x4 },
				{ "dmat4", GL_DOUBLE_MAT4 },
				{ "dmat4x2", GL_DOUBLE_MAT4x2 },
				{ "dmat4x3", GL_DOUBLE_MAT4x3 },
				{ "double", GL_DOUBLE },
				{ "dvec2", GL_DOUBLE_VEC2 },
				{ "dvec3", GL_DOUBLE_VEC3 },
				{ "dvec4", GL_DOUBLE_VEC4 },
				{ "float", GL_FLOAT },
				{ "iimage1D", GL_INT_IMAGE_1D },
				{ "iimage1DArray", GL_INT_IMAGE_1D_ARRAY },
				{ "iimage2D", GL_INT_IMAGE_2D },
				{ "iimage2DArray", GL_INT_IMAGE_2D_ARRAY },
				{ "iimage2DMS", GL_INT_IMAGE_2D_MULTISAMPLE },
				{ "iimage2DMSArray", GL_INT_IMAGE_2D_MULTISAMPLE_ARRAY },
				{ "iimage2DRect", GL_INT_IMAGE_2D_RECT },
				{ "iimage3D", GL_INT_IMAGE_3D },
				{ "iimageBuffer", GL_INT_IMAGE_BUFFER },
				{ "iimageCube", GL_INT_IMAGE_CUBE },
				{ "image1D", GL_IMAGE_1D },
				{ "image1DArray", GL_IMAGE_1D_ARRAY },
				{ "image2D", GL_IMAGE_2D },
				{ "image2DArray", GL_IMAGE_2D_ARRAY },
				{ "image2DMS", GL_IMAGE_2D_MULTISAMPLE },
				{ "image2DMSArray", GL_IMAGE_2D_MULTISAMPLE_ARRAY },
				{ "image2DRect", GL_IMAGE_2D_RECT },
				{ "image3D", GL_IMAGE_3D },
				{ "imageBuffer", GL_IMAGE_BUFFER },
				{ "imageCube", GL_IMAGE_CUBE },
				{ "int", GL_INT },
				{ "isampler1D", GL_INT_SAMPLER_1D },
				{ "isampler1DArray", GL_INT_SAMPLER_1D_ARRAY },
				{ "isampler2D", GL_INT_SAMPLER_2D },
				{ "isampler2DArray", GL_INT_SAMPLER_2D_ARRAY },
				{ "isampler2DMS", GL_INT_SAMPLER_2D_MULTISAMPLE },
				{ "isampler2DMSArray", GL_INT_SAMPLER_2D_MULTISAMPLE_ARRAY },
				{ "isampler2DRect", GL_INT_SAMPLER_2D_RECT },
				{ "isampler3D", GL_INT_SAMPLER_3D },
				{ "isamplerBuffer", GL_INT_SAMPLER_BUFFER },
				{ "isamplerCube", GL_INT_SAMPLER_CUBE },
				{ "ivec2", GL_INT_VEC2 },
				{ "ivec3", GL_INT_VEC3 },
				{ "ivec4", GL_INT_VEC4 },
				{ "mat2", GL_FLOAT_MAT2 },
				{ "mat2x3", GL_FLOAT_MAT2x3 },
				{ "mat2x4", GL_FLOAT_MAT2x4 },
				{ "mat3", GL_FLOAT_MAT3 },
				{ "mat3x2", GL_FLOAT_MAT3x2 },
				{ "mat3x4", GL_FLOAT_MAT3x4 },
				{ "mat4", GL_FLOAT_MAT4 },
				{ "mat4x2", GL_FLOAT_MAT4x2 },
				{ "mat4x3", GL_FLOAT_MAT4x3 },
				{ "sampler1D", GL_SAMPLER_1D },
				{ "sampler1DArray", GL_SAMPLER_1D_ARRAY },
				{ "sampler1DArrayShadow", GL_SAMPLER_1D_ARRAY_SHADOW },
				{ "sampler1DShadow", GL_SAMPLER_1D_SHADOW },
				{ "sampler2D", GL_SAMPLER_2D },
				{ "sampler2DArray", GL_SAMPLER_2D_ARRAY },
				{ "sampler2DArrayShadow", GL_SAMPLER_2D_ARRAY_SHADOW },
				{ "sampler2DMS", GL_SAMPLER_2D_MULTISAMPLE },
				{ "sampler2DMSArray", GL_SAMPLER_2D_MULTISAMPLE_ARRAY },
				{ "sampler2DRect", GL_SAMPLER_2D_RECT },
				{ "sampler2DRectShadow", GL_SAMPLER_2D_RECT_SHADOW },
				{ "sampler2DShadow", GL_SAMPLER_2D_SHADOW },
				{ "sampler3D", GL_SAMPLER_3D },
				{ "samplerBuffer", GL_SAMPLER_BUFFER },
				{ "samplerCube", GL_SAMPLER_CUBE },
				{ "samplerCubeShadow", GL_SAMPLER_CUBE_SHADOW },
				{ "uimage1D", GL_UNSIGNED_INT_IMAGE_1D },
				{ "uimage1DArray", GL_UNSIGNED_INT_IMAGE_1D_ARRAY },
				{ "uimage2D", GL_UNSIGNED_INT_IMAGE_2D },
				{ "uimage2DArray", GL_UNSIGNED_INT_IMAGE_2D_ARRAY },
				{ "uimage2DMS", GL_UNSIGNED_INT_IMAGE_2D_MULTISAMPLE },
				{ "uimage2DMSArray", GL_UNSIGNED_INT_IMAGE_2D_MULTISAMPLE_ARRAY },
				{ "uimage2DRect", GL_UNSIGNED_INT_IMAGE_2D_RECT },
				{ "uimage3D", GL_UNSIGNED_INT_IMAGE_3D },
				{ "uimageBuffer", GL_UNSIGNED_INT_IMAGE_BUFFER },
				{ "uimageCube", GL_UNSIGNED_INT_IMAGE_CUBE },
				{ "usampler1D", GL_UNSIGNED_INT_SAMPLER_1D },
				{ "usampler1DArray", GL_UNSIGNED_INT_SAMPLER_1D_ARRAY },
				{ "usampler2D", GL_UNSIGNED_INT_SAMPLER_2D },
				{ "usampler2DArray", GL_UNSIGNED_INT_SAMPLER_2D_ARRAY },
				{ "usampler2DMS", GL_UNSIGNED_INT_SAMPLER_2D_MULTISAMPLE },
				{ "usampler2DMSArray", GL_UNSIGNED_INT_SAMPLER_2D_MULTISAMPLE_ARRAY },
				{ "usampler2DRect", GL_UNSIGNED_INT_SAMPLER_2D_RECT },
				{ "usampler3D", GL_UNSIGNED_INT_SAMPLER_3D },
				{ "usamplerBuffer", GL_UNSIGNED_INT_SAMPLER_BUFFER },
				{ "usamplerCube", GL_UNSIGNED_INT_SAMPLER_CUBE },
				{ "uvec2", GL_UNSIGNED_INT_VEC2 },
				{ "uvec3", GL_UNSIGNED_INT_VEC3 },
				{ "uvec4", GL_UNSIGNED_INT_VEC4 },
				{ "vec2", GL_FLOAT_VEC2 },
				{ "vec3", GL_FLOAT_VEC3 },
				{ "vec4", GL_FLOAT_VEC4 }
			};

			// Note that periods are intentionally not included in this set. My reasoning is that 1) minifying tokens
			// with their fields (e.g. myStruct.myField) ensures that minification scoping remains intact (i.e.
			// myStruct.myField could safely map to A.A, which is valid since the second A is within the structure's
			// scope), and 2) floating-point numbers are pulled as a single value (which isn't strictly necessary for
			// correct minification, but slightly speeds up the program).
			private static readonly IReadOnlySet<char> Separators = new HashSet<char>(new []
			{
				'(', ')', '{', '}', '[', ']', ';', ',', '+', '-', '*', '/', '=', '>', '<', '?', ':', '!', '%', '&', '^', '|'
			});

			private static readonly IReadOnlySet<string> ImageFormats = new HashSet<string>(new []
			{
				"r11f_g11f_b10f",
				"r16",
				"r16_snorm",
				"r16f",
				"r16i",
				"r16ui",
				"r32f",
				"r32i",
				"r32ui",
				"r8",
				"r8_snorm",
				"r8i",
				"r8ui",
				"rg16",
				"rg16_snorm",
				"rg16f",
				"rg16i",
				"rg16ui",
				"rg32f",
				"rg32i",
				"rg32ui",
				"rg8",
				"rg8_snorm",
				"rg8i",
				"rg8ui",
				"rgb10_a2",
				"rgb10_a2ui",
				"rgba16",
				"rgba16_snorm",
				"rgba16f",
				"rgba16i",
				"rgba16ui",
				"rgba32f",
				"rgba32i",
				"rgba32ui",
				"rgba8",
				"rgba8_snorm",
				"rgba8i",
				"rgba8ui"
			});

			private static readonly IReadOnlySet<string> ImageTypes = new HashSet<string>(new []
			{
				"iimage1D",
				"iimage1DArray",
				"iimage2D",
				"iimage2DArray",
				"iimage2DMS",
				"iimage2DMSArray",
				"iimage2DRect",
				"iimage3D",
				"iimageBuffer",
				"iimageCube",
				"iimageCubeArray",

				"image1D",
				"image1DArray",
				"image2D",
				"image2DArray",
				"image2DMS",
				"image2DMSArray",
				"image2DRect",
				"image3D",
				"imageBuffer",
				"imageCube",
				"imageCubeArray",

				"uimage1D",
				"uimage1DArray",
				"uimage2D",
				"uimage2DArray",
				"uimage2DMS",
				"uimage2DMSArray",
				"uimage2DRect",
				"uimage3D",
				"uimageBuffer",
				"uimageCube",
				"uimageCubeArray",
			});

			private static readonly IReadOnlySet<string> MemoryQualifiers = new HashSet<string>(new []
			{
				"coherent",
				"readonly",
				"restrict",
				"volatile",
				"writeonly"
			});

			private static readonly Dictionary<string, IReadOnlyRefList<Minified>> stageStructs;
			private static readonly Dictionary<string, string> crossStageMinified;
			private static readonly Dictionary<string, string> globalMinified;
			private static readonly Dictionary<string, string> stageConstants;
			private static readonly Dictionary<string, string> stageMinified;
			private static readonly HashSet<string> crossStageSet;
			private static readonly HashSet<string> stageStructTokens;
			private static readonly HashSet<string> uniforms;
			private static readonly StringBuilder tokenizer;
			private static readonly IReadOnlyDictionary<string, string> scannedConstants;
			private static readonly IReadOnlySet<string> keywords;

			// Unfortunately, a number of these fields can't be readonly because they're dependent on shared information
			// from the UBO generator.
			private static IReadOnlyRefDictionary<string, Shared>? sharedFunctions;
			private static IReadOnlySet<string>? uboSet;
			private static TokenType currentTokenType;
			private static TokenType previousTokenType;
			private static int openings;
			private static int openingsConsumed;
			private static int uboOpenings;
			private static string? commonUbo;
			private static string? currentToken;
			private static string? previousToken;

			static Generation()
			{
				// As its name implies, "stage" minified includes every relevant token for the current stage (including
				// global fields, which are added prior to processing each individual stage). The map is also used when
				// processing shared functions.
				stageMinified = new Dictionary<string, string>();
				stageStructs = new Dictionary<string, IReadOnlyRefList<Minified>>();
				stageStructTokens = new HashSet<string>();
				stageConstants = new Dictionary<string, string>();

				// "Cross-stage" refers to both inputs and outputs.
				crossStageMinified = new Dictionary<string, string>();
				crossStageSet = new HashSet<string>();
				tokenizer = new StringBuilder();
				uniforms = new HashSet<string>();
			
				// Hardcoding GLSL keywords here quickly became way too much (i.e. took up way too much space).
				var keys = System.IO.File.ReadAllLines(Core.Path.Engine + Core.Path.Assets + Core.Path.Text + 
					"glsl_keywords" + Extension.Text);

				keys = keys.Where(s => s.Length > 0 && s[0] != '/').Select(s => s.Trim()).ToArray();

				keywords = new HashSet<string>(keys);

				// The global minified map must be mutable so that functions can call other functions declared earlier
				// in the same stage (or in a shared file processed earlier).
				globalMinified = new Dictionary<string, string>();
				scannedConstants = ScanConstants();
			}
			
			private static IReadOnlyDictionary<string, string> ScanConstants()
			{
				return Utility.Scan.AggregateMap<string, string>(Assembly.Both, (t, map) =>
				{
					if (t.IsInterface)
					{
						return;
					}

					var prefix = "";

					if (t.Has(out ConstantsAttribute? attribute))
					{
						if (attribute.Prefix != null)
						{
							prefix = attribute.Prefix;

							Debug.Assert(!prefix.HasWhitespace(), $"Invalid shader constant prefix (\"{prefix}\" " +
								"contains whitespace).");
						}
						else
						{
							prefix = t.Name;
						}
					}

					var fields = t.GetFields(Instance | Static | Public | NonPublic | DeclaredOnly).Where(field => 
						field.IsLiteral || field.IsInitOnly).ToArray();

					foreach (var field in fields)
					{
						if (field.Has(out ConstantAttribute? constant) || attribute != null)
						{
							var name = constant?.Name;

							Debug.Assert(name == null || !name.HasWhitespace(), "Invalid shader constant name " +
								$"(\"{name}\" contains whitespace).");

							var key = prefix + (name ?? field.Name.Capitalize());
							var value = (field.IsLiteral ? field.GetRawConstantValue() : field.GetValue(null))!;
							var s = value + "";

							// This trims the leading zero from applicable floats.
							if (field.FieldType == typeof(float))
							{
								var f = (float)value;

								if (f < 1 && f > -1 && f != 0)
								{
									s = s[1..];
								}
							}

							map.Add(key, s);
						}
					}
				});
			}
		
			private static IReadOnlyRefDictionary<string, Shared> LoadShared()
			{
				openings = uboOpenings;

				// Mapping functions to lists accounts for overloads.
				var fMap = new Dictionary<string, (List<string> Sources, bool UsesUbo)>();

				Files.Traverse(Core.Path.Combine(Core.Path.Engine, Core.Path.Assets, Core.Path.Shaders, Path.Shared), 
					Extension.GLSL, Traversal.Recursive, filePath =>
				{
					var source = System.IO.File.ReadAllText(filePath);

					Traverse(source, (string token, ref int i) =>
					{
						openingsConsumed = 0;

						// Shared files don't have stages, but the same map is used for consistency.
						stageMinified.AddRange(globalMinified);
						stageConstants.AddRange(scannedConstants);

						Debug.Assert(token != "const", "Don't declared global constants in shared GLSL files (use " +
							"annotations in C# instead).");

						var index = i;
						var usesUbo = false;
						var result = ConsumeFunction(source, token, ref index, out var function, innerToken =>
						{
							var period = innerToken.LastIndexOf('.');
							var portion = period >= 0 ? innerToken[..period] : string.Empty;

							if (!usesUbo && (uboSet!.Contains(innerToken) || uboSet.Contains(portion)))
							{
								usesUbo = true;
							}
						});

						fMap.GetOrCreate(function, () => (new List<string>(), usesUbo)).Item1.Add(result);

						// This accounts for overloads.
						if (!globalMinified.ContainsKey(function))
						{
							globalMinified.Add(function, Helper.Minify(globalMinified.Count - uboOpenings));
						}

						stageMinified.Clear();
						stageConstants.Clear();

						i = index;
					});
				});

				var keys = fMap.Keys.ToArray();
				var reverseMap = new Dictionary<string, string>();

				foreach (var key in keys)
				{
					reverseMap.Add(globalMinified[key], key);
				}

				var dMap = new Dictionary<string, IReadOnlyList<string>>();

				foreach (var key in keys)
				{
					var dependencies = new HashSet<string>();
					var kM = globalMinified[key];
					var (sources, usesUbo) = fMap[key];

					foreach (var source in sources)
					{
						var index = 0;
						var localPrevious = (string?)null;

						while (TryConsumeToken(source, ref index, out var token))
						{
							if (token == "(" && localPrevious != null && localPrevious != kM && reverseMap.TryGetValue(
								localPrevious, out var f))
							{
								dependencies.Add(f);
							}

							localPrevious = token;
						}
					}

					dMap.Add(key, dependencies.Count == 0 ? Array.Empty<string>() : dependencies.ToArray());
				}

				var results = new RefDictionary<string, Shared>();

				foreach (var key in keys)
				{
					var (sources, usesUbo) = fMap[key];
					var dependencies = dMap[key];

					if (!usesUbo)
					{
						var queue = new Queue<string>();

						foreach (var dependency in dependencies)
						{
							queue.Enqueue(dependency);
						}

						while (queue.Count > 0)
						{
							var dependency = queue.Dequeue();

							if (fMap[dependency].UsesUbo)
							{
								usesUbo = true;

								break;
							}

							foreach (var sub in dMap[dependency])
							{
								queue.Enqueue(sub);
							}
						}
					}

					results.Add(key, new Shared(dependencies, sources, usesUbo));
				}

				return results;
			}

			private static IReadOnlyRefList<Generated.Pair> Load(FilePath source)
			{
				var text = System.IO.File.ReadAllText(source);
				var results = new UberList<Result>();
				var blocks = new UberList<Block.Pair>();
				var assigned = new UberList<Assigned.Pair>();
				var unassignedSamplers = new UberList<Unassigned.Pair>();
				var spec = (Vertex.Specification?)null;
				var i = 0;

				while (TryConsumeToken(text, ref i, out var token))
				{
					int AdvanceBlock()
					{
						TryConsumeToken(text, ref i, out token);

						Debug.Assert(token == "{", "Unexpected token detected during shader generation (missing " +
							"opening curly brace in stage block).");

						var open = i;
						var curlyBraceDepth = 1;

						do
						{
							switch (text[i++])
							{
								case '{': curlyBraceDepth++; break;
								case '}': curlyBraceDepth--; break;
							}
						}
						while (curlyBraceDepth > 0);

						return open;
					}
					
					var stage = Enum.Parse<Stage>(token);
					var open = AdvanceBlock();
					var stageBlocks = (IReadOnlyRefList<Block>?)null;
					var stageSource = text[(open + 1)..(i - 1)];
					var stageAssigned = (IReadOnlyRefList<Assigned>?)null;
					var stageUnassignedSamplers = (IReadOnlyRefList<Unassigned>?)null;
					var rawFile = source.File.StripExtension();
					var result = stage switch
					{
						Stage.Compute => Process(rawFile, stageSource, out _, out stageBlocks, out stageAssigned,
							out stageUnassignedSamplers, stage),
						Stage.Vertex => Process(rawFile, stageSource, out spec, out stageBlocks, out stageAssigned,
							out stageUnassignedSamplers, stage),

						_ => Process(rawFile, stageSource, out _, out _, out stageAssigned, out stageUnassignedSamplers, 
							stage),
					};

					results.Add(new Result(stage, result));

					if (stageBlocks != null)
					{
						foreach (var block in stageBlocks)
						{
							blocks.Add(new Block.Pair(stage, block));
						}
					}

					if (stageAssigned != null)
					{
						foreach (var entry in stageAssigned)
						{
							assigned.Add(new Assigned.Pair(stage, entry));
						}
					}

					if (stageUnassignedSamplers != null)
					{
						foreach (var entry in stageUnassignedSamplers)
						{
							unassignedSamplers.Add(new Unassigned.Pair(stage, entry));
						}
					}
				}

				crossStageMinified.Clear();

				var list = new UberList<Generated.Pair>();
				var name = source.File.StripExtension();

				if (results.TryIndexWhere(e => e.Stage == Stage.Compute, out var index))
				{
					var filtered = blocks.
						Where(pair => pair.Stage == Stage.Compute).
						Select(pair => pair.Block).
						ToArray();

					var localAssigned = assigned.
						Where(pair => pair.Stage == Stage.Compute).
						Select(pair => pair.Assigned).
						ToArray();

					var localUnassigned = unassignedSamplers.
						Where(pair => pair.Stage == Stage.Compute).
						Select(pair => pair.Unassigned).
						ToArray();

					var @base = new Generated(
						UberList.From(localAssigned),
						UberList.From(filtered), 
						UberList.From(localUnassigned));

					var generated = new CGenerated(@base, results[index].Source);

					list.Add(new Generated.Pair(generated, name + Compute.Suffix));
				}
				
				var nonCompute = results.Where(e => e.Stage != Stage.Compute).ToArray();

				if (nonCompute.Length > 0)
				{
					var filtered = blocks.
						Where(pair => pair.Stage != Stage.Compute).
						Select(pair => pair.Block).
						ToArray();

					var localAssigned = assigned.
						Where(pair => pair.Stage != Stage.Compute).
						Select(pair => pair.Assigned).
						ToArray();

					var localUnassigned = unassignedSamplers.
						Where(pair => pair.Stage != Stage.Compute).
						Select(pair => pair.Unassigned).
						ToArray();

					var @base = new Generated(
						UberList.From(localAssigned),
						UberList.From(filtered), 
						UberList.From(localUnassigned));

					var generated = new RGenerated(@base, spec, UberList.From(nonCompute));

					list.Add(new Generated.Pair(generated, name));
				}

				return list;
			}
			
			private static bool Scan(string source, int i, int statementLimit, ScanDelegate @delegate)
			{
				var cached = new [] { currentToken, previousToken };
				var cachedTypes = new [] { currentTokenType, previousTokenType };

				bool Restore(Func<bool> callback)
				{
					var b = callback();

					currentToken = cached[0];
					currentTokenType = cachedTypes[0];
					previousToken = cached[1];
					previousTokenType = cachedTypes[1];

					return b;
				}

				return Restore(() =>
				{
					var statements = 0;
					var token = (string?)null;

					do
					{
						var previous = token;

						if (!TryConsumeToken(source, ref i, out token))
						{
							return false;
						}

						if (@delegate(token, previous, out var @break))
						{
							return true;
						}

						if (@break)
						{
							return false;
						}

						if (token == ";")
						{
							statements++;
						}
					}
					while (statements < statementLimit);

					return false;
				});
			}

			private static bool Scan(string source, int i, int statementLimit, string target)
			{
				return Scan(source, i, statementLimit, (string token, string? _, out bool @break) =>
				{
					@break = false;

					return token == target;
				});
			}

			private static bool TryConsumeToken(string source, ref int i, [NotNullWhen(true)] out string? token)
			{
				bool Inner(ref int index, [NotNullWhen(true)] out string? innerToken)
				{
					static bool IsBreaker(string source, ref int index, out string? local)
					{
						static bool IsHex(string source, ref int index, out string? local)
						{
							var c = source[index];
							
							local = c + "";

							if (c != '0' || char.ToLower(source[index + 1]) != 'x')
							{
								return false;
							}
							
							var i = index + 2;
							var builder = new StringBuilder();

							while (char.IsDigit(c = source[i]) || char.ToUpper(c) is >= 'A' and <= 'F')
							{
								builder.Append(c);
								i++;
							}

							local = "0x" + builder;
							index = i - 1;

							return true;
						}

						static bool IsScientificNotation(string source, ref int index, out string? local)
						{
							var c = source[index];
							
							local = c + "";

							if (!char.IsDigit(c))
							{
								return false;
							}

							var i = index + 1;
							var builder = new StringBuilder(c + "");

							// This doesn't account for multiple periods in an otherwise numeric string, but that
							// wouldn't be valid GLSL anyway.
							while (char.IsDigit(c = source[i++]) || c == '.')
							{
								builder.Append(c);
							}

							if (char.ToLower(c) != 'e')
							{
								return false;
							}

							builder.Append('e');
							c = source[i++];

							// Scientific notation is this context is almost always negative, but it doesn't have to be.
							if (c == '+' || c == '-')
							{
								if (c == '-')
								{
									// A positive exponent is implied if no sign is given explicitly.
									builder.Append('-');
								}

								c = source[i++];
							}

							while (char.IsDigit(c))
							{
								builder.Append(c);
								c = source[i++];
							}

							local = builder.ToString();
							index = i - 2;

							return true;
						}

						if (IsHex(source, ref index, out local) || IsScientificNotation(source, ref index, out local))
						{
							return false;
						}

						// If the current token doesn't represent scientific notation, the token will have already been
						// assigned to the current character.
						var c = source[index];

						return char.IsWhiteSpace(c) || Separators.Contains(c);
					}

					static void SetTokenType(TokenType type)
					{
						previousTokenType = currentTokenType;
						currentTokenType = type;
					}

					innerToken = null;

					if (index >= source.Length)
					{
						return false;
					}

					var c = source[index];

					bool AdvanceWhitespace(ref int local)
					{
						while (char.IsWhiteSpace(c))
						{
							local++;

							if (local == source.Length)
							{
								return false;
							}

							c = source[local];
						}

						return true;
					}

					if (!AdvanceWhitespace(ref index))
					{
						return false;
					}

					while (c == '/' && index < source.Length && TryProcessComment(source, ref index))
					{
						c = source[index];

						AdvanceWhitespace(ref index);

						c = source[index];
					}

					if (!AdvanceWhitespace(ref index))
					{
						return false;
					}

					if (Separators.Contains(c))
					{
						index++;
						innerToken = c + "";

						SetTokenType(TokenType.Separator);

						return true;
					}
					
					while (!IsBreaker(source, ref index, out var local))
					{
						tokenizer.Append(local);

						index++;
					}

					innerToken = tokenizer.ToString();

					tokenizer.Clear();

					SetTokenType(TokenType.NonSeparator);

					return true;
				}

				previousToken = currentToken;

				var b = Inner(ref i, out token);

				currentToken = token;

				return b;
			}
			
			// This function returns true if a comment (single-line or multi-line) was consumed.
			private static bool TryProcessComment(string source, ref int i)
			{
				var c = source[i];
				var next = source[i + 1];

				if (c != '/' || !(next == '/' || next == '*'))
				{
					return false;
				}

				// For some reason, shader generation seems to succeed or fail differently between my desktop and
				// laptop. I know the problem relates to line endings, but I don't know why the two machines (both
				// running Windows 10) would differ. Until I figure out the deeper issue, this logic allows shader
				// generation to proceed in either case.
				var newline = source.Contains(Environment.NewLine) ? Environment.NewLine : "\n";
				var length = newline.Length;

				switch (next)
				{
					case '/':
					{
						while (i < source.Length - length && source[i..(i + length)] != newline)
						{
							i++;
						}

						i += length;

						return true;
					}

					case '*':
					{
						while (i < source.Length - 1 && (source[i] != '*' || source[i + 1] != '/'))
						{
							i++;
						}

						i += 2;

						return true;
					}
				}

				return false;
			}

			private static string Clean(string raw)
			{
				// This strips the zero from floats if applicable.
				if (raw.TryIndexOf('.', out var period) && float.TryParse(raw, out var f) && f.Abs() < 1)
				{
					var isNegative = f < 0;
					var fractional = raw[(period + 1)..];

					raw = (isNegative ? "-" : string.Empty) + $".{fractional}";
				}

				return raw;
			}

			private static string ConsumeFunction(string source, string @return, ref int i, out string function,
				 Action<string>? callback)
			{
				var index = i;
				var cachedConsumed = openingsConsumed;

				string KnownNext(string? expected = null)
				{
					var b = TryConsumeToken(source, ref index, out var token);

					Debug.Assert(b, "Token consumption unexpected returned false while processing GLSL function. " +
						"This shouldn't be possible since this local function is designed for use only when it's " +
						"known that EOF won't be reached yet.");

					Debug.Assert(expected == null || token == expected, "Unexpected token detected while minifying " +
						"GLSL source (within function).");

					return token!;
				}

				bool UnknownNext([NotNullWhen(true)] out string? token)
				{
					return TryConsumeToken(source, ref index, out token);
				}

				var result = new StringBuilder();
				var functionMinified = new Dictionary<string, string>(stageMinified);
				var functionConstants = new Dictionary<string, string>(stageConstants);

				@return = Minify(@return, stageMinified, stageConstants);
				function = KnownNext();

	#if DEBUG
				Debug.Assert(!keywords.Contains(function), "Function name is a reserved GLSL keyword.");
	#endif

				var mFunction = Minify(function, stageMinified, stageConstants);

				KnownNext("(");

				if (function != "main" && !functionMinified.ContainsKey(function))
				{
					// This ensures that the function name isn't reused when minifying parameters or statements.
					functionMinified.Add(function, mFunction);
				}

				result.Append($"{@return} {mFunction}(");

				var token = KnownNext();
				var iteration = 0;

				// This means that at least one argument is present.
				while (token != ")")
				{
					var type = Minify(++iteration == 1 ? token : KnownNext(), stageMinified, functionConstants);
					var parameter = Minify(KnownNext(), functionMinified, functionConstants);

					result.Append($"{type} {parameter}");
					token = KnownNext();
					
					// The alternative here is a comma.
					if (token == "[")
					{
						result.Append('[');

						while ((token = KnownNext()) != "]")
						{
							result.Append(functionConstants.TryGetValue(token, out var constant) ? constant : token);
						}

						result.Append(']');
						token = KnownNext();

						continue;
					}
					
					if (token == ")")
					{
						break;
					}

					result.Append(',');
				}

				KnownNext("{");

				result.Append("){");

				var curlyBraceDepth = 1;

				do
				{
					void Append(string s, StringBuilder builder)
					{
						if (currentTokenType == TokenType.NonSeparator && previousTokenType == TokenType.NonSeparator)
						{
							builder.Append(' ');

							if (stageStructs.TryGetValue(previousToken!, out var list))
							{
								foreach (var (field, m) in list)
								{
									functionMinified.Add($"{currentToken}.{field}", $"{s}.{m}");
								}

								openings += list.Count;
							}
						}

						builder.Append(s);
					}

					if (!UnknownNext(out token))
					{
						break;
					}

					if (currentTokenType == TokenType.Separator)
					{
						result.Append(token);

						if (token.Length == 1)
						{
							switch (token[0])
							{
								case '{': curlyBraceDepth++; break;
								case '}': curlyBraceDepth--; break;
							}
						}
					}
					else if (token == "const")
					{
						var type = Minify(KnownNext(), stageMinified, stageConstants);
						var key = KnownNext();

						KnownNext("=");

						var builder = new StringBuilder();

						while ((token = KnownNext()) != ";")
						{
							Append(token, builder);
						}

						var value = Clean(builder.ToString());
						
						// Note that it's possible that replacing a constant with its value might increase the size of
						// the minified shader relative to keeping the constant declaration in place. I figure that
						// situation is uncommon enough that it's not worth the extra complexity of scanning forward
						// though the shader to find out for sure. If I ever change my mind, the commented-out code
						// below preserves the declaration.
						functionConstants.Add(key, value);
						
						/*
						var kM = Minify(key, functionMinified, functionConstants);

						result.Append($"const {type} {kM}={value};");
						*/
						
					}
					else
					{
						callback?.Invoke(token);

						Append(Minify(Clean(token), new [] { functionMinified, stageMinified }, functionConstants),
							result);
					}
				}
				while (curlyBraceDepth > 0);
				
				i = index;

				openingsConsumed = cachedConsumed;
				
				return result.ToString();
			}
			
			private static string Minify(string token, Dictionary<string, string> map,
				IReadOnlyDictionary<string, string> constants)
			{
				return Minify(token, new [] { map }, constants);
			}

			private static string Minify(string token, IReadOnlyList<Dictionary<string, string>> maps,
				IReadOnlyDictionary<string, string> constants)
			{
				static bool IsHex(string s)
				{
					return s.StartsWith("0x");
				}

				static bool IsScientificNotation(string s)
				{
					var e = s.IndexOf('e');

					if (e == -1)
					{
						return false;
					}

					var mantissa = s[..e];
					var exponent = s[(e + 1)..];

					// From some quick testing using an online tool, the mantissa can be a float, but the exponent must
					// be an integer.
					return float.TryParse(mantissa, out _) && int.TryParse(exponent, out _);
				}

				// The last part of this condition catches swizzling following an expression in parentheses (e.g.
				// (a + b).xyz). It's also syntactically valid to surround portions of a chained call to a nested
				// structure field with parentheses (e.g. (myStruct.myNestedStruct).myField), but handling that case is
				// more complicated (I'd have to track whether the text within the parentheses corresponds to a token
				// rather than an expression) and in practice, I can't imagine why I'd ever want or need to write code
				// like that.
				if (keywords.Contains(token) || uniforms.Contains(token) || IsHex(token) || 
					IsScientificNotation(token) || stageStructTokens.Contains(token) || (token == "main" && 
						previousToken == "void") || token[0] == '.')
				{
					return token;
				}

				if (constants.TryGetValue(token, out var constant))
				{
					return constant;
				}

				// Parsing floats should also cover hardcoded integers.
				if (float.TryParse(token, out var f))
				{
					// This strips the leading 0 when possible (e.g. .123 rather than 0.123).
					return token.Length > 1 && f > -1 && f < 1 ? token[1..] : token;
				}

				// This handles numeric literals with suffixes (floats and uints).
				var suffix = char.ToLower(token[^1]);

				if ((suffix == 'u' && int.TryParse(token[..^1], out _)) || (suffix == 'f' && float.TryParse(token[..^1],
					out _)))
				{
					return token;
				}

				// In practice, the token will have either zero periods or one (at least that's my assumption at time of
				// writing). To have multiple periods, you'd need nested structures (which I'm hoping I won't need).
				var period = token.LastIndexOf('.');
				var root = period >= 0 ? token[..period] : null;

				// This accounts for calling fields on keywords or uniforms (e.g. gl_FragCoord.xy).
				if (root != null && (keywords.Contains(root) || uniforms.Contains(root) || 
					stageStructTokens.Contains(root)))
				{
					return token;
				}
				
				string? m;

				// This approach (using a list of maps) is useful when minifying functions, since each token is first
				// checked against the function map, then the stage map (i.e. local scope first, then outer scope).
				foreach (var map in maps)
				{
					// Note that this check implicitly handles overloaded functions too. This generator doesn't
					// explicitly know *which* overload a particular function usage corresponds to, but that's fine
					// because the GLSL compiler can handle overload resolution as long as the (minified) function names
					// are consistent.
					if (map.TryGetValue(token, out m))
					{
						return m;
					}

					// This second check enforces that structure fields aren't incorrectly minified. For example, if a
					// function has a struct argument (e.g. vec2 vector, minified to A), then access a field from that
					// structure (e.g. vector.x), that token should be minified to A.x, not a brand new token mapping
					// "vector.x" to a minified value.
					if (root != null && map.TryGetValue(root, out m))
					{
						return $"{m}.{token[(period + 1)..]}";
					}
				}

				var last = maps[0];
				var offset = 0;
				
				if (openingsConsumed < openings)
				{
					offset = openings;

					openingsConsumed++;
				}

				m = Helper.Minify(last.Count - offset);
				
				while (crossStageSet.Contains(m))
				{
					openings--;

					offset--;
					m = Helper.Minify(last.Count - offset);
				}

				last.Add(token, m);

				return m;
			}
			
			// The vertex stage requires special handling to determine the vertex specification.
			private static string Process(
				RawFile rawFile, 
				string source, 
				out Vertex.Specification? spec,
				out IReadOnlyRefList<Block>? blocks,
				out IReadOnlyRefList<Assigned>? assigned,
				out IReadOnlyRefList<Unassigned>? unassignedSamplers, 
				Stage stage)
			{
				const string WrongToken = "Unexpected token detected while minifying GLSL source.";

				stageMinified.AddRange(globalMinified);
				stageMinified.AddRange(crossStageMinified);
				stageConstants.AddRange(scannedConstants);

				openingsConsumed = 0;
				openings = uboOpenings + (crossStageMinified.Count > 0
					? crossStageMinified.Min(pair => Helper.Unminify(pair.Value)) - (stageMinified.Count -
						uboOpenings)
					: 0);

				crossStageSet.AddRange(crossStageMinified.Values);
				crossStageMinified.Clear();

				spec = null;

				// The contents of the shader file itself (plus includes) are processed first, and then additional
				// source text is prepended (GLSL version, then the common UBO and shared functions as applicable).
				var result = new StringBuilder();
				var sharedFunctionsUsed = new HashSet<string>();
				var attributes = new UberList<Vertex.Attribute>();
				var attributeGroups = new UberList<ReadOnlySlice>();
				var attributeOffset = 0;
				var attributeGroupCount = 0;
				var localAssigned = (UberList<Assigned>?)null;
				var localUnassignedSamplers = (UberList<Unassigned>?)null;
				var specGroups = (UberList<Vertex.Specification.Group>?)null;
				var shouldGenerateSpec = true;
				var indexBuffer = (string?)null;
				var lastSource = (string?)null;
				var usesUbo = false;
				var inOuts = 0;
				var inOutLayoutAlreadyDefined = false;
				var structSizes = new Dictionary<string, int>();
				var blockList = (UberList<Block>?)null;

				void TryTrackGroups()
				{
					if (attributeGroupCount == 0)
					{
						return;
					}

					Debug.Assert(lastSource != null, "Missing vertex source (required since the format is not marked " +
						"implicit).");

					var stride = attributeOffset;

					attributeGroups.Add(new ReadOnlySlice(attributes.Count - attributeGroupCount, attributeGroupCount));
					specGroups ??= new UberList<Vertex.Specification.Group>();
					specGroups.Add(new Vertex.Specification.Group(stride, lastSource!));
					attributeOffset = 0;
					attributeGroupCount = 0;
				}

				Traverse(source, (string token, ref int i) =>
				{
					var index = i;

					Annotation ProcessAnnotation()
					{
						var annotation = Next();
						var args = Next() == "(" ? new List<string>() : null;

						if (args != null)
						{
							do
							{
								var arg = Next();

								args.Add(arg[0] == '"' ? arg[1..^1] : arg);
							}
							while (Next() != ")");
							
							Next("]");
						}

						return new Annotation(args, annotation);
					}

					int Evaluate(IReadOnlyList<string> list)
					{
						switch (list.Count)
						{
							// This indicates a dynamic array in an SSBO.
							case 0: return -1;
							case 1: return int.Parse(list[0]);
						}

	#if DEBUG
						if (list.Count != 3)
						{
							throw new NotImplementedException("Complex constant expressions are currently " +
								"unimplemented.");
						}
	#endif

						var a = int.Parse(list[0]);
						var b = int.Parse(list[2]);

						return list[1][0] switch
						{
							'+' => a + b,
							'-' => a - b,
							'*' => a * b,
							'/' => a / b
						};
					}

					string Next(string? expected = null)
					{
						var b = TryConsumeToken(source, ref index, out var nullableToken);

						if (stage != Stage.Compute && previousToken != null && stageStructs.TryGetValue(previousToken, 
							out var fields))
						{
							foreach (var e in fields)
							{
								stageStructTokens.Add($"{nullableToken}.{e.Field}");
							}
						}

						Debug.Assert(b, "Token consumption unexpectedly returned false (i.e. reached the end of the " +
							"current source). This shouldn't be possible within this local function since shaders " +
							"are expected to end with the main function (which DOES check for EOF).");
						
						Debug.Assert(expected == null || nullableToken == expected, WrongToken);

						return nullableToken!;
					}

					string ProcessUniform(bool isAssigned, out int iOut, out string type)
					{
						string s;
						
						// Image uniforms require special handling.
						if (MemoryQualifiers.Contains(s = Next()))
						{
							var qualifiers = new List<string>();

							do
							{
								qualifiers.Add(s);
							}
							while (MemoryQualifiers.Contains(s = Next()));
							
							var format = s;
							var memory = string.Join(' ', qualifiers);

							result.Append($"layout({format}){memory} ");
							s = Next();
						}

						// Uniform names are kept intact for location retrieval by name. Theoretically, uniforms could
						// still be minified as long as the actual names were tracked separately, but then you'd also
						// have to serialize and deserialize that map and retrieval just becomes more complicated
						// (especially when considering nested structure fields).
						var unminifiedType = s;

						type = Minify(unminifiedType, stageMinified, stageConstants);
						
						var variable = Next();

						// This step is important for shadow casters.
						if (variable == "worldMatrix")
						{
							result.Append("layout(location=0)");
						}

						result.Append($"uniform {type} {variable}");

						if (Next() == "[")
						{
							var list = new List<string>();

							while ((token = Next()) != "]")
							{
								list.Add(stageConstants.TryGetValue(token, out var constant) ? constant : token);
							}

							var length = Evaluate(list);

							Next(";");

							result.Append($"[{length}]");
						}

						result.Append(';');
						iOut = index;

						// Tracking uniforms explicitly is important to ensure they're not minified later (when used in
						// other places in the shader source).
						uniforms.Add(variable);
						
						if (!isAssigned && UniformTypes.TryGetValue(unminifiedType, out var value) && 
							Helper.IsSamplerType(value))
						{
							localUnassignedSamplers ??= new UberList<Unassigned>();
							localUnassignedSamplers.Add(new Unassigned(variable, localUnassignedSamplers.Count));
						}

						return variable;
					}

					void ProcessHandler(string? explicitName, HType handlerType, out int iOut)
					{
						token = Next();

						// This is assumed to be a [Named] annotation.
						if (token == "[")
						{
							explicitName = ProcessAnnotation().Args![0];
							token = Next();
						}

						if (token == "ubo")
						{
							ProcessUbo(explicitName, handlerType, out iOut);
						}
						else
						{
							ProcessSsbo(explicitName, handlerType, out iOut);
						}
					}

					void ProcessInputOutput(string? annotation = null)
					{
						var isIn = token == "in";
						var next = Next();
						var isFlat = next == "flat";

						if (isFlat)
						{
							next = Next();
						}

						var type = Minify(next, stageMinified, stageConstants);
						var variable = Next();
						var vM = Minify(variable, stageMinified, stageConstants);
						var layout = (string?)null;

						if (stage == Stage.Vertex && isIn && shouldGenerateSpec)
						{
							var a = annotation != null ? $"{annotation} " : "";
							var s = $"{a}in {type} {variable};";

							attributes.Add(Helper.AnalyzeAttribute(s, ref attributeOffset));
							attributeGroupCount++;

							if (!inOutLayoutAlreadyDefined && inOuts > 0 || Scan(source, index, 2, "in"))
							{
								layout = $"layout(location={inOuts++})";
							}
						}

						// This approach only tracks output variables across stages (which is fine since vertex inputs
						// aren't relevant past the vertex stage).
						if (!isIn)
						{
							if (!inOutLayoutAlreadyDefined && stage == Stage.Fragment)
							{
								if (inOuts > 0 || Scan(source, index, 2, "out"))
								{
									layout = $"layout(location={inOuts++})";
								}
							}
							else if (!crossStageMinified.ContainsKey(variable))
							{
								crossStageMinified.Add(variable, vM);
							}
						}

						if (layout != null)
						{
							result.Append(layout);
						}
						
						result.Append($"{token} ");
						result.Append(isFlat ? "flat " : string.Empty);
						result.Append($"{type} {vM}");
						next = Next();
						
						// This is valid in hull, domain, and geometry shaders.
						if (next == "[")
						{
							Next("]");
							Next(";");

							result.Append("[]");
						}

						result.Append(';');
						inOutLayoutAlreadyDefined = false;
					}
					
					void ProcessSsbo(string? explicitName, HType handlerType, out int iOut)
					{
						var restrictions = new List<string>();

						while (token != "ssbo")
						{
							restrictions.Add(token);
							token = Next();
						}
						
						var ssbo = Next();
						var sM = Minify(ssbo, stageMinified, stageConstants);
						
						ssbo = explicitName ?? $"{rawFile}_{ssbo.Uncapitalize()}";

						Next("{");

						var fields = new List<(string Type, string Field, string FM, int Length)>();

						while ((token = Next()) != "}")
						{
							var type = Minify(token, stageMinified, stageConstants);
							var field = Next();
							var fM = Minify(field, stageMinified, stageConstants);
							var length = 1;

							if ((token = Next()) == "[")
							{
								var list = new List<string>();

								while ((token = Next()) != "]")
								{
									list.Add(stageConstants.TryGetValue(token, out var constant) ? constant : token);
								}

								length = Evaluate(list);

								Next(";");
							}
							else
							{
								Debug.Assert(token == ";", WrongToken);
							}

							fields.Add((type, field, fM, length));
						}
							
						Debug.Assert(fields.Count > 0, "Empty SSBO detected.");
						
						var capacity = (int?)null;

						if (handlerType is HType.Persistent or HType.Raw)
						{
							capacity = Helper.ComputeBlockSize(fields.Select(e => (e.Type, e.Length)).ToArray(), 
								structSizes);
						}

						blockList ??= new UberList<Block>();
						blockList.Add(new Block(BlockType.Ssbo, handlerType, capacity, sM, ssbo));

						result.Append("layout(std430)");
						result.Append(string.Join(' ', restrictions));
						result.Append($" buffer {sM}{{");

						foreach (var (type, _, fM, length) in fields)
						{
							result.Append((string?)$"{type} {fM}");

							if (length == -1)
							{
								result.Append("[]");
							}
							else if (length > 1)
							{
								result.Append($"[{length}]");
							}

							result.Append(';');
						}

						result.Append("};");
						iOut = index;
					}

					void ProcessUbo(string? explicitName, HType handlerType, out int i)
					{
						var ubo = Next();
						var uboM = Minify(ubo, stageMinified, stageConstants);
						
						ubo = explicitName ?? $"{rawFile}_{ubo.Uncapitalize()}";

						Next("{");

						var fields = new List<(string Type, string Field, string FM, int Length)>();

						while ((token = Next()) != "}")
						{
							var type = Minify(token, stageMinified, stageConstants);
							var field = Next();
							var fM = Minify(field, stageMinified, stageConstants);
							var length = 1;

							if ((token = Next()) == "[")
							{
								var list = new List<string>();

								while ((token = Next()) != "]")
								{
									list.Add(stageConstants.TryGetValue(token, out var constant) ? constant : token);
								}

								length = Evaluate(list);

								Next(";");
							}
							else
							{
								Debug.Assert(token == ";", WrongToken);
							}

							fields.Add((type, field, fM, length));
						}
							
						Debug.Assert(fields.Count > 0, "Empty UBO detected.");
						
						var capacity = Helper.ComputeBlockSize(fields.Select(e => (e.Type, e.Length)).ToArray(), 
							structSizes);

						blockList ??= new UberList<Block>();
						blockList.Add(new Block(BlockType.Ubo, handlerType, capacity, uboM, ubo));
						result.Append($"layout(std140)uniform {uboM}{{");

						foreach (var (type, field, fM, length) in fields)
						{
							result.Append((string?)$"{type} {fM}");

							if (length == -1)
							{
								result.Append("[]");
							}
							else if (length > 1)
							{
								result.Append($"[{length}]");
							}

							result.Append(';');
						}

						result.Append("};");
						i = index;
					}

					switch (token)
					{
						case "coherent":
						case "readonly":
						case "restrict":
						case "ssbo":
						case "volatile":
						case "writeonly": Debug.Fail("Missing SSBO handler annotation."); break;
						case "const":
						{
							Next();

							var key = Next();

							Next("=");

							var value = Clean(Next());

							// This assumes that constants will always be a single value rather than an expression (e.g.
							// const double TwoPi = 3.141592653589793 * 2;).
							Next(";");

							// This approach ends up inlining constants. Likely the optimal approach most of the time,
							// but note that in rare cases, inlining constants might actually end up increasing the
							// final size of the minified file (if the value is longer than the name and the constant is
							// only used a few times).
							stageConstants.Add(key, value);

							i = index;

							// This block keeps the constant intact (but still minified) without the source.
							/*
							var type = Minify(Next(), stageMinified);
							var variable = Minify(Next(), stageMinified);

							Next("=");

							var value = Next();

							Next(";");

							result.Append($"const {type} {variable}={value};");
							i = index;
							*/

							break;
						}

						case "flat":
						{
							result.Append("flat ");

							ProcessInputOutput();

							i = index;

							break;
						}
							
						case "in":
						case "out":
						{
							ProcessInputOutput();

							i = index;

							break;
						}

						case "layout":
						{
							// Valid GLSL layout qualifiers vary by stage and semantic (in vs. out). Rather than deal
							// with that complexity here, tokens are simply concatenated together, which also ends up
							// working out because nothing within a layout qualifier needs minification (besides
							// constants).
							result.Append("layout");

							while ((token = Next()) != ")")
							{
								result.Append(stageConstants.TryGetValue(token, out var constant) ? constant : token);
							}

							result.Append(')');

							// Layout qualifiers can be self-contained statements (ending with "in;" or "out;"), or can
							// precede an input or output variable. Determining which is important since layouts are
							// automatically prepended to inputs and outputs in some cases (specifically for vertex and
							// fragment stages), but only if the layout isn't specified explicitly.
							var local = index;
							var semantic = Next();
							var s = Next();

							if (s == ";")
							{
								result.Append($"{semantic};");
								i = index;
							}
							else
							{
								i = local;
								inOutLayoutAlreadyDefined = true;
							}

							break;
						}

						case "struct":
						{
							// If a structure is used as a uniform or within a uniform buffer, its fields must remain
							// unminified in order to be retrievable at runtime. It's true that uniforms can be scanned
							// at runtime, but there'd be no way to map minified strings back to recognizable values
							// unless that mapping was ALSO baked into the file, so yeah, better to introduce complexity
							// here.
							bool ShouldMinifyFields(string @struct, int i)
							{
								var withinUbo = false;
								var withinUniform = false;

								return !Scan(source, i, int.MaxValue, (string t, string? previous, out bool @break) =>
								{
									if (@break = (t == "main" && previous == "void"))
									{
										return false;
									}

									switch (t)
									{
										case "ubo": withinUbo = true; break;
										case "uniform": withinUniform = true; break;
										case ";":
										case "}":
										{
											withinUbo = false;
											withinUniform = false;

											break;
										}

										default:
										{
											if (t == @struct && (withinUbo || withinUniform))
											{
												return true;
											}	

											break;
										}
									}

									return false;
								});
							}

							var @struct = Next();
							var sM = Minify(@struct, stageMinified, stageConstants);
							var fields = new List<(string Type, string TM, string Field, string FM, int Length)>();
							var structMinified = new Dictionary<string, string>();
							var shouldMinifyFields = ShouldMinifyFields(@struct, i);

							Next("{");

							token = Next();

							while (token != "}")
							{
								var type = token;
								var tM = Minify(type, stageMinified, stageConstants);
								var field = Next();
								var fM = shouldMinifyFields ? Minify(field, structMinified, stageConstants) : field;
								var length = 1;

								if (Next() == "[")
								{
									var list = new List<string>();

									while ((token = Next()) != "]")
									{
										list.Add(stageConstants.TryGetValue(token, out var constant) 
											? constant 
											: token);
									}

									length = Evaluate(list);

									Next(";");
								}

								fields.Add((type, tM, field, fM, length));
								token = Next();
							}
							
							Next(";");

							// I'm not certain (at time of writing) whether an empty struct is syntactically valid in
							// GLSL. Even if it is, there's no benefit I'm aware of in using an empty struct. As such,
							// empty structs are disallowed.
							Debug.Assert(fields.Count > 0, "Empty struct detected.");

							var size = Helper.ComputeBlockSize(fields.Select(e => (e.Type, e.Length)).ToArray(), 
								structSizes);
							
							result.Append($"struct {sM}{{");
							fields.ForEach(e => result.Append($"{e.TM} {e.FM};"));
							result.Append("};");
							structSizes.Add(sM, size);

							stageStructs.Add(@struct, UberList.From(fields.Select(e => new Minified(e.Field, e.FM))
								.ToArray()));

							i = index;

							break;
						}

						case "ubo": Debug.Fail("Missing SSBO handler annotation."); break;
						case "uniform": ProcessUniform(false, out i, out _); break;

						default:
						{
							// This means that the current token is an annotation.
							if (token[0] == '[')
							{
								var (args, annotation) = ProcessAnnotation();

								switch (annotation)
								{
									case "Dynamic": 
									case "Permanent": 
									case "Persistent": 
									case "Raw":
									case "Restricted": ProcessHandler(null, Enum.Parse<HType>(annotation), out i);
										break;

									case "Implicit":
									{
										Debug.Assert(shouldGenerateSpec, "Duplicate attribute detected ([Implicit]).");
										Debug.Assert(specGroups == null && indexBuffer == null, "The current vertex " +
											"format non-implicit (can't use [Implicit]).");

										shouldGenerateSpec = false;

										break;
									}

									case "Indexed":
									{
										Debug.Assert(indexBuffer == null, "Duplicate attribute detected ([Indexed]).");
										Debug.Assert(shouldGenerateSpec, "The current vertex format is implicit " +
											"(can't use [Indexed]).");

										indexBuffer = args![0];

										break;
									}

									case "Named":
									{
										var name = args![0];

										token = Next();

										// This is assumed to be a handler annotation.
										if (token == "[")
										{
											annotation = ProcessAnnotation().SAnnotation;

											ProcessHandler(name, Enum.Parse<HType>(annotation), out i);
										}
										else
										{
											Debug.Fail("Missing block handler annotation.");
										}

										break;
									}
									
									case "Source":
									{
										Debug.Assert(lastSource == null || attributeGroupCount > 0, "Invalid " +
											"[Source] attribute detected (each source must be associated with one or " +
											"more attributes).");

										Debug.Assert(shouldGenerateSpec, "The current format is implicit (can't use " +
											"[Source].");

										TryTrackGroups();

										lastSource = args![0];

										break;
									}

									// [Upload] annotations play no role in the shader directly, and are instead parsed
									// out manually during mesh generation.
									case "Upload": break;
									case "Value":
									{
										Next("uniform");

										var uniform = ProcessUniform(true, out i, out var type);
										var value = string.Join(',', args!);
										var uType = UniformTypes[type];

										localAssigned ??= new UberList<Assigned>();
										localAssigned.Add(new Assigned(uniform, value, uType));

										break;
									}

									default:
									{
										token = Next();

										ProcessInputOutput($"[{annotation}]");

										break;
									}
								}
								
								i = index;

								break;
							}

							result.Append(ConsumeFunction(source, token, ref i, out _, innerToken =>
							{
								var period = innerToken.LastIndexOf('.');
								var portion = period >= 0 ? innerToken[..period] : string.Empty;

								// This accounts for single tokens with swizzle on UBO fields (e.g. camera.eye.xyz).
								if (!usesUbo && (uboSet!.Contains(innerToken) || uboSet.Contains(portion)))
								{
									usesUbo = true;
								}
								else if (sharedFunctions!.TryGetValue(innerToken, out var entry))
								{
									sharedFunctionsUsed.Add(innerToken);
									usesUbo |= entry.UsesUbo;
								}
							}));

							break;
						}
					}
				});

				assigned = localAssigned;
				unassignedSamplers = localUnassignedSamplers;

				stageMinified.Clear();
				stageStructs.Clear();
				stageStructTokens.Clear();
				stageConstants.Clear();
				crossStageSet.Clear();

				if (stage == Stage.Vertex && shouldGenerateSpec)
				{
					TryTrackGroups();

					var key = Vertex.Format.Hash(attributes!, attributeGroups!);
					var format = new Vertex.Format(key, attributes!, attributeGroups!);

					spec = new Vertex.Specification(specGroups!, format, indexBuffer);
				}

				var s = result.ToString();

				result.Clear();
				result.Append($"#version {Game.GLMajor}{Game.GLMinor}0 core\n");

				if (usesUbo)
				{
					result.Append(commonUbo);
				}

				var covered = new HashSet<string>();
				var order = new List<string>();

				void Recurse(string f)
				{
					var dependencies = sharedFunctions!.Ref(f).Dependencies;

					foreach (var dependent in dependencies)
					{
						Recurse(dependent);
					}

					if (!covered.Contains(f))
					{
						order.Add(f);
						covered.Add(f);
					}
				}

				foreach (var f in sharedFunctionsUsed)
				{
					Recurse(f);
				}

				// This approach prepends ALL overloads of a shared function when used. Not an ideal solution since it's
				// very likely wasteful (if the shader doesn't call all overloads), but unfortunately, proper overload
				// resolution (i.e. detecting which specific overloads are used) is a challenging problem. A possible
				// improvement for the future (although still short of full resolution) would be to match based on
				// argument count.
				foreach (var f in order)
				{
					var sources = sharedFunctions!.Ref(f).Sources;

					foreach (var fSource in sources)
					{
						result.Append(fSource);
					}
				}

				blocks = blockList;

				return result + s;
			}

			[Dependent(typeof(Ubo))]
			[Generator]
			[Input(Root.Both, null, Core.Path.Raw.Shaders, Extension.Raw.Shader)]
			[Output(Core.Path.Raw.Shaders + "Sources")]
			private static void Generate(IReadOnlyList<FilePath> sources, Binary.IWriter writer, IGeneration generation)
			{
				commonUbo = generation.Get<string>("ubo_string");

				var uboMinified = generation.Get<IReadOnlyDictionary<string, string>>("ubo_minified");

				uboSet = new HashSet<string>(uboMinified.Keys);
				uboOpenings = uboSet.Count(s => s.Contains('.'));
				globalMinified.AddRange(uboMinified);
				sharedFunctions = LoadShared();
				
				foreach (var source in sources)
				{
					if (generation.TryIgnore())
					{
						continue;
					}
					
					Load(source).Iterate((ref Generated.Pair pair) =>
					{
						generation.Entry(source, pair.Name, pair.Generated, writer, EntryStyle.Unique);
					});
					
					generation.Step();
				}
			}

			private static void Traverse(string source, TokenDelegate @delegate)
			{
				var i = 0;

				while (i < source.Length && TryConsumeToken(source, ref i, out var token))
				{
					@delegate(token, ref i);
				}
			}

			private delegate bool ScanDelegate(string token, string? previous, out bool @break);
			private delegate void TokenDelegate(string token, ref int i);

			private readonly record struct Annotation(IReadOnlyList<string>? Args, string SAnnotation);
			private readonly record struct Minified(string Field, string SMinified);
			private readonly record struct Shared(IReadOnlyList<string> Dependencies, IReadOnlyList<string> Sources,
				bool UsesUbo);

			private readonly record struct Assigned(string Uniform, string Value, uint Type) : ISerializable<Assigned>
			{
				static Assigned ISerializable<Assigned>.Read(Binary.IReader reader)
				{
					return new Assigned(reader.ReadString(), reader.ReadString(), reader.ReadUInt());
				}
				
				public readonly record struct Pair(Stage Stage, Assigned Assigned);

				void ISerializable<Assigned>.Add(Binary.Helper helper)
				{
					helper.Add(Uniform);
					helper.Add(Value);
					helper.Add(Type);
				}

				void ISerializable<Assigned>.Write(Binary.IWriter writer)
				{
					writer.Write(Uniform);
					writer.Write(Value);
					writer.Write(Type);
				}
			}

			private readonly record struct Block(BlockType Type, HType Handler, int? Capacity, string SBlock,
				string Buffer) : ISerializable<Block>
			{
				static Block ISerializable<Block>.Read(Binary.IReader reader)
				{
					// These explicit declarations exist to match how fields are ordered in the loaded version of this
					// structure.
					var bType = reader.ReadEnum<BlockType>();
					var hType = reader.ReadEnum<HType>();
					var sBlock = reader.ReadString();
					var capacity = reader.ReadNInt();
					var buffer = reader.ReadString();

					return new Block(bType, hType, capacity, sBlock, buffer);
				}
				
				public readonly record struct Pair(Stage Stage, Block Block);

				void ISerializable<Block>.Add(Binary.Helper helper)
				{
					helper.Add(Type);
					helper.Add(Handler);
					helper.Add(SBlock);
					helper.Add(Capacity);
					helper.Add(Buffer);
				}

				void ISerializable<Block>.Write(Binary.IWriter writer)
				{
					// Note that this ordering (and the ordering in related functions within this structure) match the
					// corresponding loaded structure. Same is true for other structures loaded at runtime.
					writer.Write(Type);
					writer.Write(Handler);
					writer.Write(SBlock);
					writer.Write(Capacity);
					writer.Write(Buffer);
				}
			}

			private readonly record struct CGenerated(Generated Generated, string Source) : IGenerated
			{
				void IGenerated.Write(Binary.IWriter writer)
				{
					Generated.Write(writer);

					writer.Write(Source);
				}
			}

			private readonly record struct Generated
			(
				IReadOnlyRefList<Assigned> SAssigned,
				IReadOnlyRefList<Block> Blocks,
				IReadOnlyRefList<Unassigned> SUnassigned)
			{
				public void Write(Binary.IWriter writer)
				{
					writer.WriteS(Blocks);
					writer.WriteS(SAssigned);
					writer.WriteS(SUnassigned);
				}

				[DebuggerDisplay("Name={Name}")]
				public readonly record struct Pair(IGenerated Generated, string Name);
			}

			private readonly record struct Result(Stage Stage, string Source) : ISerializable<Result>
			{
				static Result ISerializable<Result>.Read(Binary.IReader reader)
				{
					return new Result(reader.ReadEnum<Stage>(), reader.ReadString());
				}

				void ISerializable<Result>.Add(Binary.Helper helper)
				{
					helper.Add(Stage);
					helper.Add(Source);
				}

				void ISerializable<Result>.Write(Binary.IWriter writer)
				{
					writer.Write(Stage);
					writer.Write(Source);
				}
			}

			private readonly record struct RGenerated
			(
				Generated Generated,
				Vertex.Specification? Specification,
				IReadOnlyRefList<Result> Stages) : IGenerated
			{
				void IGenerated.Write(Binary.IWriter writer)
				{
					Generated.Write(writer);

					writer.WriteNS(Specification);
					writer.WriteS(Stages);
				}
			}

			private readonly record struct Unassigned(string Sampler, int Declared) : ISerializable<Unassigned>
			{
				static Unassigned ISerializable<Unassigned>.Read(Binary.IReader reader)
				{
					return new Unassigned(reader.ReadString(), reader.ReadInt());
				}

				public readonly record struct Pair(Stage Stage, Unassigned Unassigned);

				void ISerializable<Unassigned>.Add(Binary.Helper helper)
				{
					helper.Add(Sampler);
					helper.Add(Declared);
				}

				void ISerializable<Unassigned>.Write(Binary.IWriter writer)
				{
					writer.Write(Sampler);
					writer.Write(Declared);
				}
			}
		}
	}
#endif
}

def f(n):
    s = ""
    while n > 0:
        s += str(n % 6)
        n //= 6
    s = s[::-1]
    return s

Min = 1000000000000000
for N in range(1, 1000):
    b = f(N)
    if int(b) % 3 == 0:
        b = b + f(N)[:2]
    else:
        b = b + f((int(b) % 3) * 10)
    R = int(b, 6)
    if R > 680:
        Min = min(R, Min)
print(Min)

#include <DFPlayerMini_Fast.h>
#include <LowPower.h>
#include <SoftwareSerial.h>

const int PIR_PIN = 2;
#define BUSY_PIN 7
#define led 13

volatile byte song = 0;

SoftwareSerial mySoftwareSerial(10, 12); // RX, TX
DFPlayerMini_Fast myMP3;

void setup() {
  pinMode(led, OUTPUT);
  pinMode(PIR_PIN,INPUT);
  pinMode(BUSY_PIN, INPUT);
  Serial.begin(115200);
  mySoftwareSerial.begin(9600);
  myMP3.begin(mySoftwareSerial);
   randomSeed(A0);
 
Serial.println();
  Serial.println(F("DFRobot DFPlayer Mini Demo"));
  Serial.println(F("Initializing DFPlayer ... (May take 3~5 seconds)"));
  
  if (!myMP3.begin(mySoftwareSerial)) {  /
    Serial.println(F("Unable to begin:"));
    Serial.println(F("1.Please recheck the connection!"));
    Serial.println(F("2.Please insert the SD card!"));
    while(true);
  }
  Serial.println(F("DFPlayer Mini online."));
  digitalWrite(led,LOW);
 
}

void playSound() {
  song = random(1, 12);
  myMP3.volume(30);
  myMP3.play(song);
  Serial.print("Play Song! ");
  Serial.println(song);
 
 }


void loop() {

  mySoftwareSerial.flush();
  attachInterrupt(digitalPinToInterrupt(PIR_PIN), playSound, RISING);
  Serial.println ("enter Sleep!");delay(500);
  LowPower.powerDown(SLEEP_FOREVER, ADC_OFF, BOD_OFF); 
  
  
 detachInterrupt(digitalPinToInterrupt(PIR_PIN));
 
}

