function manageAnInventory(input) {
    let journal = input.shift().split(', ');
    let commands = { 'Collect': collect, 'Drop': drop, 'Combine Items': combineItems, 'Renew': renew };
    for (let el of input) {
        if (el === 'Craft!') {
            break;
        }

        let [command, items] = el.split(' - ');
        if (command === 'Combine Items') {
            let [item1, item2] = items.split(':');
            journal = commands[command](journal, item1, item2);
        } else {
            journal = commands[command](journal, items);
        }
    }

    console.log(journal.join(', '));

    function collect(arr, item) {
        if (!arr.includes(item)) {
            arr.push(item);
        }

        return arr;
    }

    function drop(arr, item) {
        if (arr.includes(item)) {
            arr = arr.filter(a => a !== item);
        }

        return arr;
    }

    function combineItems(arr, oldItem, newItem) {
        if (arr.includes(oldItem)) {
            let startIndex = arr.indexOf(oldItem);
            arr.splice(startIndex + 1, 0, newItem);
        }

        return arr
    }

    function renew(arr, item) {
        if (arr.includes(item)) {
            let startIndex = arr.indexOf(item);
            let theRenewedItem = arr.splice(startIndex, 1);
            arr.push(theRenewedItem);
        }

        return arr;
    }
}

int fun(int target, int ball, bool pranay, map<pii, int> &dp)
{
    if(dp.count({target, ball}))
    {
        return dp[{target, ball}];
    }
    if(target <= 0) return dp[{target, ball}] = 1;
    if(ball == 7 || pranay)
    {
        return dp[{target, ball}] = target <= 0;
    }
    vi runs = {0, 1, 2, 3, 4, 6};
    int ans = 0;

    for(auto i : runs)
    {
        if(i & 1)
        {
            ans += fun(target - i, ball + 1, true, dp);
        }
        else 
        {
            ans += fun(target - i, ball + 1, false, dp);
        }
    }
    return dp[{target, ball}] = ans;
}

#include <bits/stdc++.h>
#include <ext/pb_ds/assoc_container.hpp>

#define l first
#define r second

#define int int64_t
#define double long double

using namespace std;
using namespace __gnu_pbds;

std::mt19937_64 rnd(std::chrono::steady_clock::now().time_since_epoch().count());
std::uniform_real_distribution<double> rnd_double(0, 1);

int nextInt(int r) {  // [0; R)
    return rnd() % r;
}

int nextInt(int l, int r) {  // [L; R)
    return l + rnd() % (r - l);
}

double nextDouble() {  // [0; 1]
    return rnd_double(rnd);
}

double nextDouble(double r) {  // [0; R]
    return r * nextDouble();
}

double nextDouble(double l, double r) {  // [L; R]
    return l + (r - l) * nextDouble();
}

template <typename T>
using Orset = __gnu_pbds::tree<T, __gnu_pbds::null_type, std::less<T>, __gnu_pbds::rb_tree_tag,
        __gnu_pbds::tree_order_statistics_node_update>;

